// function to aid autocomplete
placeChanged() {
    let place = this.autocomplete.getPlace();
   
    if(!place.geometry){
        window.alert(`no details available for input : ${place.name}`);
        return
    }
    if(place.geometry.viewport){
        this.gmaps.fitBounds(place.geometry.viewport);
    }else{
        this.gmaps.setCenter(place.geometry.location);
        this.gmaps.setZoom(15);
    }
}

//calculates route and displays route information as HTML
calculateAndDisplayRoute() {
  console.log('i am in display route')
  console.log(`origin location: ${this.originTarget.value} destination: ${this.destTarget.value}`)
  this.directionsService
    .route({
      origin: {
        query: this.originTarget.value,
        // query: this.coords,
      },
      destination: {
        query: this.destTarget.value,
      },
      travelMode: google.maps.TravelMode.WALKING,
    })
    .then((response) => {
      this.directionsRenderer.setDirections(response);
      this.outputTarget.innerHTML = "<div class='alert-info'>From: " + this.originTarget.value + ".<br />To: " + this.destTarget.value + ".<br /> Walking distance <i class='fas fa-road'></i> : " + response.routes[0].legs[0].distance.text + ".<br />Duration <i class='fas fa-hourglass-start'></i> : " + response.routes[0].legs[0].duration.text + ".</div>";
     
    })
    .catch((e) => window.alert("Directions request failed due to " + e));
}   
   
